interface CardProps {
    imageBuyer: string;
    buyer: string;
    seller: string;
    imageSeller: string;
    unitcost: string;
    xirr: string;
    tenure: string;
  }
  
export const CardComponent:React.FC <CardProps> =({
    imageBuyer,
    buyer,
    seller,
    imageSeller,
    unitcost,
    xirr,
    tenure
})=>{
    return <div className="w-80 h-60 shadow rounded-2xl bg-white px-10">
    <div className="flex justify-between">
        <div className="flex " >
           <img  className="w-16 h-16 object-cover rounded-full"src="imageBuyer"/>
           <div className="ml-4">
            <p className="text-gray-500 text-xs">Buyer</p>
            <p className="font-small text-sm">{buyer}</p>
          </div>

        </div>
        <div className="flex">
        
           <div className="ml-4">
            <p className="text-gray-500 text-xs">Seller</p>
            <p className="font-small text-sm">{seller}</p>
          </div>
          <img  className="w-16 h-16 object-cover rounded-full"src="imageSeller"/>


        </div>

    </div>
    </div>
}
